import Head from 'next/head'
import Link from 'next/link';

const firstPost = () => {
    return (
        <>
            <Head>
                <title>First post, bitch</title>
                <link rel="icon" href="/favicon.ico" />
            </Head>
            <h2>First post!</h2>
            <h3>
                <Link href="/"><a>Back to Home</a></Link>
            </h3>
        </>
    );
};

export default firstPost;
